### Ethereum Blockchain Messenger Smart Contract

Below is a Solidity smart contract that meets the specified requirements. This contract, named `BlockchainMessenger`, allows users to save messages on the blockchain, update these messages privately, and count the number of updates.

```solidity
pragma solidity ^0.8.0;

contract BlockchainMessenger {
    // Mapping of message IDs to their respective message contents
    mapping (uint256 => string) public messages;

    // Mapping of message IDs to their update counts
    mapping (uint256 => uint256) public updateCounts;

    // Mapping of message IDs to their authors (deployer's address)
    mapping (uint256 => address) public authors;

    // Counter for generating unique message IDs
    uint256 public messageIdCounter = 0;

    // Function to save a new message on the blockchain
    function saveMessage(string memory _message) public {
        // Generate a new unique message ID
        uint256 messageId = messageIdCounter++;

        // Save the message with the generated ID
        messages[messageId] = _message;

        // Set the author of the message to the deployer's address
        authors[messageId] = msg.sender;

        // Initialize the update count to 0
        updateCounts[messageId] = 0;
    }

    // Function to update a message privately
    function updateMessage(uint256 _messageId, string memory _newMessage) public {
        // Check if the message ID exists
        require(messages[_messageId] != "", "Message ID does not exist.");

        // Check if the caller is the author of the message
        require(msg.sender == authors[_messageId], "Only the author can update the message.");

        // Update the message content
        messages[_messageId] = _newMessage;

        // Increment the update count
        updateCounts[_messageId]++;
    }

    // Function to get the message content by ID
    function getMessage(uint256 _messageId) public view returns (string memory) {
        // Check if the message ID exists
        require(messages[_messageId] != "", "Message ID does not exist.");

        // Return the message content
        return messages[_messageId];
    }

    // Function to get the update count by ID
    function getUpdateCount(uint256 _messageId) public view returns (uint256) {
        // Return the update count
        return updateCounts[_messageId];
    }
}
```

